export const ExpenseIcon = (name: string) => {
  if (name === "Food") {
    return <Food />;
  } else if (name === "Shopping") {
    return <ShoppingCart />;
  } else if (name === "Personal") {
    return <Personal />;
  } else if (name === "Housing") {
    return <Housing />;
  } else if (name === "Transportation") {
    return <Transportation />;
  } else if (name === "Health & Wellness") {
    return <Health />;
  } else if (name === "Dining Out") {
    return <Dinner />;
  } else if (name === "Travel") {
    return <Travel />;
  } else if (name === "Savings & Investments") {
    return <Saving />;
  } else if (name === "Business Expenses") {
    return <Business />;
  } else if(name === "Education"){
    return <Education />
  } else {
    return null;
  }
};
